import React from "react";

const Home = (props) => {
  return (
    <div className="home">
      <div>
        <h1>Sam + Logan</h1>
        <h2>May 23-29, 2022</h2>
        <h2>Barcelona, Spain</h2>
      </div>
    </div>
  );
};

export default Home;
